script: |
  super -f tsv -I q805.sql > q805.out

vector: true

inputs:
  - name: q805.sql
    data: |
      SELECT (a+b+c+d+e)/5
      FROM t1
      WHERE d NOT BETWEEN 110 AND 150
      AND (e>a AND e<b)
      AND e+d BETWEEN a+b-10 AND c+130
      ORDER BY 1;
  - name: t1

outputs:
  - name: q805.out
    data: |
